import { Col, Image, Row } from 'antd';
import { Content } from 'antd/lib/layout/layout';
import React from "react";

const Profile = () => {
  return (
    <Row justify="center">
      <Col span={20}>
        <Image
          width={1000}
          src="http://localhost:3000/HR_employee.png"
        />
        <Content><h1></h1>this is content</Content>
      </Col>
    </Row>
  );
};

export default Profile;
